import Link from "next/link";
import Nav from "./Nav";
import styled from "styled-components";

const Logo = styled.h1`
  background: "red";
`;

const Header = () => (
  <header>
    <div className="bar">
      <Link href="/">
        <Logo>Hanger</Logo>
      </Link>
    </div>
    <div className="sub-bar">
      <p>Search</p>
    </div>
    <Nav />
  </header>
);

export default Header;
